    <canvas id="canvas" width="400" height="400" style="display:none"></canvas>
    <div id="png-container"></div>

    <style type="text/css">
        svg.colimg{width:60; height: 60px; display:none}
        img{width:60px; height:60px;}
    </style>
    <script>
    $("svg").each(function(){
        var $this =  $(this);
        //console.log( $(this) ) ;
        var svgString = new XMLSerializer().serializeToString(this);
        var canvas = document.getElementById("canvas");
        var ctx = canvas.getContext("2d");
        var DOMURL = self.URL || self.webkitURL || self;
        var img = new Image();
        var svg = new Blob([svgString], {type: "image/svg+xml;charset=utf-8"});
        var url = DOMURL.createObjectURL(svg);
        var imageHtml=""
        img.onload = function() {
            ctx.drawImage(img, 0, 0);
            var png = canvas.toDataURL("image/png");
            imageHtml = '<img src="'+png+'"/>'
            //document.querySelector('#png-container').innerHTML += imageHtml;
            $this.replaceWith(imageHtml);
            DOMURL.revokeObjectURL(png);
            
        };
        img.src = url;
    })
